class Profile_ChangePassword extends StatefulWidget {
  static const String idScreen = "Profile_ChangePassword";
  Profile_ChangePassword({
    Key? key,
  }) : super(key: key);

  @override
  _Profile_ChangePassword createState() => _Profile_ChangePassword();
}

class _Profile_ChangePassword extends State<Profile_ChangePassword> {
  final formKey = GlobalKey<FormState>();
  bool _securetext = true;
  String newPassword = '';
  String confirmPassword = '';
  String currentPassword = "";
  bool isHidden = false;
  Map passwordMap = {};

  Future userLogin() async {
    var urrr = Uri.parse(defaultUrl + 'mob_change_password');
    var response = await http.post(urrr, body: json.encode(passwordMap));
    print(response.body.toString());

    // If the Response Message is Matched.
    if (jsonDecode(response.body) == 'Successfully Changed') {
      Navigator.pushAndRemoveUntil(
          context, MaterialPageRoute(builder: (context) => SignIn()), (route) => false);
    } else {
      Fluttertoast.showToast(msg: 'Wrong Current Password');
    }
  }

