                      fontWeight: FontWeight.w300,
                    ),
                    prefixIcon: Icon(
                      Icons.lock,
                      color: Color(0xff444444),
                    ),
                  ),
                  keyboardType: TextInputType.visiblePassword,
                  obscureText: isHidden,
                ),
              ),
            ),
            Padding(
              padding: const EdgeInsets.only(top: 30),
