                    onPressed: () {
                      if (newPassword == "" ||
                          currentPassword == "" ||
                          confirmPassword == '') {
                        Fluttertoast.showToast(msg: "All feilds are reqired");
                      } else {
                        if (newPassword == confirmPassword) {
                          setState(() {
                            passwordMap['email'] = userDetailsResponse['username'];
                            passwordMap['id'] = userDetailsResponse['id'];
                            passwordMap['password'] = currentPassword;
                            passwordMap['newPassword'] = newPassword;
                          });
                          userLogin();
                          // print(passwordMap);
                        } else {
                          Fluttertoast.showToast(
                              msg: "New password and Confirm Password Missmatched");
                        }
                      }
                    },
                    child: Text(
                      "Save",
                      style: TextStyle(
                        fontFamily: 'Poppins',
                        fontSize: 16,
                        color: const Color(0xffffffff),
